using System.Linq;
using System.Net.Http;
using System.Text;
using System.Threading.Tasks;
using Microsoft.Maui.Controls;
namespace MauiApp3;
public partial class MainPage : ContentPage
{
    private readonly HttpClient _httpClient = new HttpClient();
    //private readonly string _input = "Hello, World!"; // replace with your input string
    //private readonly DateTime _startTime = DateTime.UtcNow;
    //private readonly DateTime _endTime = DateTime.UtcNow.AddHours(1);
    private const int _endtime = 3600;
    private int _starttime = 0;
    
    public MainPage()
    {
        InitializeComponent();
    }

    private void OnCounterClicked(object sender, EventArgs e)
    {
        Device.StartTimer(TimeSpan.FromSeconds(1), () =>
        {
            if (_starttime > _endtime)
            {
                return false;
            }

            Task.Run(async () =>
            {
                _starttime++;
                var response = await _httpClient.GetAsync("https://serverforapp10.onrender."); //new StringContent("\"" + _input + "\"", Encoding.UTF8, "application/json")
                var output = await response.Content.ReadAsStringAsync();
                //Console.WriteLine(output);
            });
            

            SemanticScreenReader.Announce(CounterBtn.Text);

            return true;
        });
    }
}

